import { Button } from "@mui/material";
import { Col, Container, Row } from "react-bootstrap";
import { useSelector } from "react-redux";
import { useNavigate } from "react-router";

export function StudentList() {
    const isLogeddin = useSelector((state) => state.schoolData.isLogeddin);
    const navigate = useNavigate();
    return (
        <>
            <div>
                {isLogeddin ? (
                    <Container className="mt-5">
                        <Row>
                            <Col lg={2}></Col>
                            <Col lg={8}>
                            <Alert className="text-center">Student-List</Alert>
                            </Col>
                            <Col lg={2}></Col>
                        </Row>

                    </Container>
                ) : (
                    <div className="mt-5">
                        <h4 className="text-center mt-5">Plese Login</h4>
                        <div className="text-center"><Button variant="outlined" onClick={() => navigate("/login")}>Login</Button></div>
                    </div>
                )

                }

            </div>

        </>
    )
}
